import matplotlib.pyplot as plt
import requests
import pandas as pd
from sklearn.metrics import confusion_matrix, ConfusionMatrixDisplay

tabela_comparativa = pd.DataFrame(columns=['Base Name','Best k','Accuracy','Precision','Recall'])
Bases = ["appendicitis.dat", "banana.dat", "bupa.dat", "haberman.dat", "heart.dat", "ionosphere.dat", "monk-2.dat", "phoneme.dat", "pima.dat", "sonar.dat"]
for base in Bases:
  URL = 'https://raw.githubusercontent.com/Jhferr/Kdd/main/' + base
  Arquivo = requests.get(URL)
  file = Arquivo.text.split("\n")
  info = []
  data = []
  for i in file:
    if "@" in i:
      info.append(i.strip().split("\n"))
    else:
      data.append(i.strip().split("\n"))
  Data = []
  data.pop()
  for i in data:
    i = i[0]
    line = i.replace(',',' ').split()
    line2 = [float(i) for i in line[:-1]]
    line2.append(line[-1])
    Data.append(line2)
  random.shuffle(Data)
  atributos = info[-4][0]
  x = atributos.find("{")
  y = atributos.find(",")
  z = atributos.find("}")
  class1 = atributos[x+1:y]
  class2 = atributos[y+1:z]
  class2 = class2.replace(" ", "")
  best = (0, 0)
  for nn in [2, 3, 4, 5, 6, 7, 8, 9, 10]:
    precision, recall, accuracy, classes = knn_statistics(Data, nn, class1, class2)
    if accuracy > best[0]:
      best = (accuracy, nn)
  precision, recall, accuracy, classes = knn_statistics(Data, best[1], class1, class2)
  nova_linha = {'Base Name':base,'Best k':best[1],'Accuracy':accuracy,'Precision':precision, 'Recall':recall}
  tabela_comparativa = tabela_comparativa.append(nova_linha, ignore_index=True)
  print("Base = ", base)

  cm = confusion_matrix([c[0] for c in classes], [c[1] for c in classes], labels=(class1, class2)) #plotando a matriz de confusão
  dl = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=(class1, class2))
  dl.plot(cmap='PuBu')
  plt.show()

